INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場", 2834, 91002, 8, 1, 5118061, "ペコリーヌとの出会い", 0, 0, 40, 2, "青空の下で謁見", 7, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場", 2835, 91002, 8, 1, 5118062, "マホとの出会い", 0, 0, 40, 2, "未来の騎空団\nマスコット？", 7, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地", 2837, 91002, 8, 1, 5118063, "アキノとの出会い", 0, 0, 40, 2, "お嬢さまからの\n緊急依頼", 7, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場", 4108402, 91002, 8, 1, 5118064, "ジュンとの出会い", 0, 0, 40, 2, "黄金色の悩みごと", 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場", 4107402, 91002, 8, 1, 5118065, "カオリとの出会い", 0, 0, 40, 2, "白熱！　格闘大会！", 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町", 9000227, 91002, 8, 1, 5118066, "ニノンとの出会い", 1, 0, 40, 2, "祭り太鼓はオーエドの華", 16, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場", 2101181, 91002, 8, 1, 5118067, "スズナとの出会い", 0, 0, 40, 3, "人気者は遅れて\nやってくる", 19, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地", 4109402, 91002, 8, 1, 5118068, "ナナカとの出会い", 0, 0, 40, 3, "巫女・ミーツ・魔法少女", 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場", 4305402, 91002, 8, 1, 5118069, "キャル＆コッコロとの出会い", 0, 0, 40, 3, "ネズ耳は二度なくなる", 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地", 4101402, 91002, 8, 1, 5118070, "ユカリとの出会い", 0, 0, 40, 3, "この出会いにカンパイ！", 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地", 4106402, 91002, 8, 1, 5118071, "アオイとの出会い", 0, 0, 40, 3, "陰陽アンサンブル", 18, 10118);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES ("ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場", 2836, 91002, 8, 1, 5118072, "シノブとの出会い", 1, 0, 40, 3, "運試し十番勝負！", 7, 10118);
